(14, 'Targeting DNA damage repair gives radiation therapy a boost', 'Everyone’s DNA is constantly damaged by environmental factors, even by the process of aging. DNA damage accumulates throughout our lives, so cells contain repair mechanisms that help our bodies compensate for the damage. Cancer also causes DNA damage, but the accumulation of too much damage can kill a tumor cell, so cancer hijacks the repair mechanisms to maintain a balance that keeps it alive despite its dysfunction......\n\n', 'data:image/jpeg;base64,');
INSERT INTO `blogs` (`id`, `title`, `description`, `img`) VALUES
(15, 'Getting to the bottom of a medulloblastoma mystery', 'Surgery is a necessary, life-saving treatment for many people with cancer including children who have brain tumors. But an invasive procedure on such a sensitive part of the body as the developing brain can have unintended side effects. This is the case with a condition called posterior fossa syndrome. This syndrome develops in 25-40% of children with the brain tumor medulloblastoma following surgery.\n\n', 'data:image/jpeg;base64,');
INSERT INTO `blogs` (`id`, `title`, `description`, `img`) VALUES
(16, 'Healthy lifestyles: mitigating the risk of cognitive impairment in childhood cancer survivors', 'As we age, all people naturally experience some cognitive decline in processing speed, memory and executive function. For example, parents confronted with math homework from their children often struggle to recall how to apply equations that were once second nature. Lawyers, with once-sharp memories of decades of case history, begin forgetting critical details in the heat of the moment during a trial.\n\n', 'data:image/jpeg;base64,');
INSERT INTO `blogs` (`id`, `title`, `description`, `img`) VALUES
(18, 'Diagnostic Imaging receives hospital’s first Expanded Access use designation from FDA', 'Often, following radiation therapy or surgery, a radiologist may find a spot that looks suspicious by MRI – it could be harmless scar tissue or a concerning tumor recurrence, but the MRI finding is ambiguous. At St. Jude Children’s Research Hospital, members of the Department of Diagnostic Imaging have an innovative way to clarify ambiguous findings using a positron emission tomography (PET) scan with [11C]Methionine (MET).\n\n', 'data:image/jpeg;base64,');

